{
  "version": "0.2",
  "phases": {
    "build": {
      "commands": [
        "cp -r CDK Ohana-Springboot/",
        "mv ./Ohana-Springboot/CDK ./Ohana-Springboot/build_artifacts",
        "cd CDK",
        "npm ci",
        "npm run build",
        "npx cdk synth",
        "cp -r cdk.out/* ../Ohana-Springboot/build_artifacts/",
        "cd ..",
        "cp -r aws/infra/codepipeline/* Ohana-Springboot/",
        "cd Ohana-Springboot",
        "ls",
        "chmod +x test.sh",
        "./test.sh",
        "ls -al"
      ]
    }
  },
  "artifacts": {
    "base-directory": "./Ohana-Springboot/build_artifacts",
    "files": "**/*"
  }
}
